1cedb601-e270-4e30-8127-fd36d71e3b5f=\#\# 1 Introduction\r\n\r\nThe Audit Trail module creates a log history for the changes made to objects in your Mendix application.\r\n\r\n\#\#\# 1.1 Typical Use Cases\r\n\r\nThis module keeps keep track of what changes are made in your Mendix application as well as when, by whom, and how much.\r\n\r\n\#\#\# 1.2 Features\r\n\r\n* Keep track of objects that are created, changed, or deleted\r\n* Only save changes made on an object that has the `AuditTrail.AudittrailSuperClass` as a superclass and where the commit is done with events\r\n    (this could be a performance risk for apps with too many entities or records)\r\n* Add a commit event which analysis and save the changes\r\n* Log the complete state of the entity (all attributes) or only the changed attributes by modifying a constant\r\n\r\n\#\# 2 Configuration\r\n\r\nThe two sections below describe the two options for configuring this module.\r\n\r\n\#\#\# 2.1 Associations & Events\r\n\r\nFor this configuration option, add a reference set association from your entity to the **Log** entity or an association from the **Log** entity\r\nto the entity that needs to be audited. Add an after-create, before-commit, and before-delete event to your entity that is identical to the events\r\non the **AudittrailSuperClass**. The Java actions will automatically create the log item and all the required log lines based on the changes.\r\n\r\nNext, configure the **LogOnlyChangedAttributes** constant for whether you want to log all the attributes or just the changes.\r\n\r\nFinally, add the **LogOverviewSnippet** snippet to a page in a custom module.\r\n\r\n\#\#\# 2.2 Inheritance\r\n\r\nFor this option, all the objects you want to log need to have the **AuditTrail.AudittrailSuperClass** as a superclass (note that this is not possible\r\nfor subclasses of the **System.User** object. The module will then automatically log all the changes on the create, commit, and delete events.\r\n\r\nNext, configure the **LogOnlyChangedAttributes** constant for whether you want to log all the attributes or just the changes.\r\n\r\nFinally, add the **LogOverviewSnippet** snippet to a page in a custom module.\r\n\r\n\#\# 3 Changing Audit Behavior\r\n\r\nChanging the audit behavior is easily done by altering the values of the following constants (if no value is set, the default is used)\:\r\n\r\n* **IncludeOnlyChangedAttributes** (default\: false) \u2013 This determines if the module should create a log line for every single member every time it\r\n    initiates the Audit, or if it should only log the changed members.\r\n* **LogAllMembersOnCreate** (default\: true) \u2013 This property only affects the scenario when **IncludeOnlyChangedAttributes** is **false**. This\r\n    indicates if the application will create a log line for all attributes when the record is created.\r\n* **IncludeCalculatedAttributes** (default\: false) \u2013 This determines if the module should resolve calculated attributes and compare if the result\r\n    has changed since the last commit.\r\n* **CreateLogObjectWithoutMemberChanges** (default\: false) \u2013 If none of the members have been changed, this property determines whether a commit\r\n    will still generate a log record populated only with the `changed date` and `changed by` fields.\r\n* **LogLineDateFormat** (default\: MM/dd/yyyy) \u2013 This constant determines the format to be used to convert date attributes to strings. It uses the\r\n    same pattern as used by the Parse & Format Date Function Calls of Mendix (see https\://docs.mendix.com/refguide/parse-and-format-date-function-calls).\r\n* **LogServerTimeZoneDateNotation** (default\: true) \u2013 This determines if the date should be audited in the **ServerTimeZone**. If both the session\r\n    time zone and **ServerTimeZone** are enabled, you will see two dates in the audit overview.\r\n* **ServerTimeZone** (default\: Etc/UTC) \u2013 This the time zone in which the server time zone is printed. This will be a static time zone and should\r\n    match the notation as used in Java.\r\n* **LogSessionTimeZoneDateNotation** (default\: true) \u2013 This determines if the date should be audited in the session time zone of the user that makes\r\n    the change. If both the session time zone and the server time zone are enabled, you will see two dates in the audit overview.
